import React from 'react';
import { Prices, About, Training, Navbar, Contacts } from './components';
import { Footer } from './containers';
import './App.css';


const App = () => {
  return (
    <div className='App'>
      <Navbar />
      <About />
      <Training />
      <Prices />
      <Contacts />
      <Footer />
    </div>
  )
}

export default App
import ContactForm from './ContactForm';
